7a2","metadata":{"execution":{"iopub.execute_input":"2025-02-26T13:45:02.341755Z","iopub.status.busy":"2025-02-26T13:45:02.340096Z","iopub.status.idle":"2025-02-26T13:45:02.35453Z","shell.execute_reply":"2025-02-26T13:45:02.352894Z"},"papermill":{"duration":0.043913,"end_time":"2025-02-26T13:45:02.357475","exception":false,"start_time":"2025-02-26T13:45:02.313562","status":"completed"},"tags":[]},"outputs":[],"source":["linear_interpolation <- function(data_vec, start_missing_indices, end_missing_indices){\n","  missing_size = end_missing_indices - start_missing_indices + 1\n","  slope = (data_vec[end_missing_indices+1]-data_vec[start_missing_indices-1])/(missing_size+1)\n","  \n","  filling_data = rep(NA, missing_size)\n","  for (i in 1:missing_size){\n","    filling_data[i] = data_vec[start_missing_indices-1] + slope * i\n","  }\n","  return(filling_data) \n","}"]},{"cell_type":"code","execution_count":29,"id":"5325d1f0","metadata":{"execution":{"iopub.execute_input":"2025-02-26T13:45:02.425537Z","iopub.status.busy":"2025-02-26T13:45:02.424116Z","iopub.status.idle":"2025-02-26T13:45:02.438234Z","shell.execute_reply":"2025-02-26T13:45:02.436609Z"},"papermill":{"duration":0.060114,"end_time":"2025-02-26T13:45:02.441243","exception":false,"start_time":"2025-02-26T13:45:02.381129","status":"completed"},"tags":[]},"outputs":[],"source":["find_missing_index <- function(input_vec){\n","  start_missing_index <- c()\n","  end_missing_index <- c()\n","  missing_values <- which(is.na(input_vec))\n","  start_missing_index[1] <- missing_values[1]\n","  \n","  for (i in 2:(length(missing_values))){\n","    if (missing_values[i]-missing_values[i-1] > 1){\n","      start_missing_index <- c(start_missing_index, missing_values[i]) \n","      end_missing_index <- c(end_missing_index, missing_values[i-1]) \n","    }\n","  }\n","  end_missing_index <- c(end_missing_index, missing_values[length(missing_values)])\n","  missing_period <- end_missing_index - start_missing_index + 1\n","  \n","  input_vec_missingness_index <- as.data.frame(cbind(start_missing_index, end_missing_index, missing_period))\n","  return(input_vec_missingness_index)\n","}"]},{"cell_type":"code","execution_count":30,"id":"b3f1131a","metadata":{"execution":{"iopub.execute_input":"2025-02-26T13:45:02.492242Z","iopub.status.busy":"2025-02-26T13:45:02.490795Z","iopub.status.idle":"2025-02-26T13:45:02.505113Z","shell.execute_reply":"2025-02-26T13:45:02.503361Z"},"papermill":{"duration":0.042996,"end_time":"2025-02-26T13:45:02.508127","exception":false,"start_time":"2025-02-26T13:45:02.465131","status":"completed"},"tags":[]},"outputs":[],"source":["linear_interpolation_df <- function(df, col_names, cut_off){\n","  for (col_name in col_names){\n","    input_vec <- df[[col_name]]\n","    input_vec_missingness_index <- find_missing_index(input_vec)\n","\n","    for (i in 1:nrow(input_vec_missingness_index)){\n","      if (input_vec_missingness_index$missing_period[i] <= cut_off){\n","        start = input_vec_missingness_index$start_missing_index[i]\n","        end = input_vec_missingness_index$end_missing_index[i]\n","          \n","        filling_gap <- linear_interpolation(data_vec = input_vec, \n","                                            start_missing_indices = start, \n","                                            end_missing_indices = end)  \n","        input_vec[start:end] <- filling_gap\n","        df[[col_name]] <- input_vec\n","      } \n","    }\n","  }\n","  return(df)\n","} "]},{"cell_type":"code","execution_count":31,"id":"f3e438b0","metadata":{"execution":{"iopub.execute_input":"2025-02-26T13:45:02.559917Z","iopub.status.busy":"2025-02-26T13:45:02.558303Z","iopub.status.idle":"2025-02-26T13:45:02.612311Z","shell.execute_reply":"2025-02-26T13:45:02.610537Z"},"papermill":{"duration":0.082892,"end_time":"2025-02-26T13:45:02.615494","exception":false,"start_time":"2025-02-26T13:45:02.532602","status":"completed"},"tags":[]},"outputs":[],"source":["yarmouth_df_interp